        <p>Resumo financeiro</p>
        <div>
          <button></button><button></button><button></button>
        </div>
      </div>
     <ul>
        { listTransactions.map((transaction, index) =>
            <li>
                <Card transaction={transaction} key={index} />
            </li>
        )}
     </ul>
    </>
   )
}
